import mc from "./main.module.scss";
//components//
import PseudoInputs from "../inputs/pseudoInputs/PseudoInputs";

const Main = () => {
  return (
    <div className={mc.container}>
      <div className={mc.players}>
        <div className={mc.player1}>
          <h3>Player1</h3>
          <PseudoInputs
            labelContent="Pseudo"
            // inputValue=
            // inputType,
            // handleInputChange,
            // handleInputActive,
            // handleInputInactive,
            // labelUp,
            // name,
          />
        </div>
        <div className={mc.player2}>
          <h3>Player2</h3>
          <PseudoInputs />
        </div>
      </div>
    </div>
  );
};

export default Main;
